At some point, everyone has had a neighbor that seems a bit overly flirtatious, and always makes crude sexual innuendoes.
Well these are those neighbors! They're called Swingers! They're in every city, in every state in the country and this is what happens behind closed doors when they find other swingers that love to swap partners and just fuck each other crazy!
Hey, can you blame them, they're young, sexy and horny. This is what open marriage is all about... open to fucking anyone you want.
